import * as React from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import CountrySelect from '../../components/country/countrylist';
import moment from 'moment';
import api from '../../components/API/API';
import SessionContext from '../../components/session/SessionContext';
import { useContext } from 'react';



const theme = createTheme();

export default function SignUp() {
    const {
        session: { user },
        actions: { logout },
      } = useContext(SessionContext);

      const { id, email, name, lastname, avatar, address, photo, phone } = user;
    const today = moment().format("YYYY.MM.DD");
  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    let [state] = useState({
        user_id: id,
        "space": "10",
        "title": "To Lebaon",
        "from_country": "Lebanon",
        "to_country": "Australia",
        "date_depart": "2021-10-10",
        "date_arrive": "2021-10-20",
        "note": "22dasdasdasdasd",
      })

      const handleChange = (event) => {
        let value = event.target.value;
        let name = event.target.name;

        setFullname((prevalue) => {
          return {
            ...prevalue,   // Spread Operator               
            [name]: value
          }
        })
      }
    const body={
        "user_id": id,
        "space": "10",
        "title": "To Lebaon",
        "from_country": "Lebanon",
        "to_country": "Australia",
        "date_depart": "2021-10-10",
        "date_arrive": "2021-10-20",
        "note": "22dasdasdasdasd",


    }
    api.post('/blogs',body)

    console.log({
      email: data.get('email'),
      password: data.get('password'),
    });
  };

  return (
    <ThemeProvider theme={theme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
            <LockOutlinedIcon />
          </Avatar>
          <Typography component="h1" variant="h5">
            Create New Post
          </Typography>
          <Box component="form" noValidate onSubmit={handleSubmit} sx={{ mt: 3 }}>
            <Grid container spacing={2}>
              <Grid item xs={12} sm={6}>
              <CountrySelect 
               label="From Country" 
              selectedcountry={(e)=>console.log(e.target.value)}
              />


              </Grid>
              <Grid item xs={12} sm={6}>
             <CountrySelect       label="To Country"        selectedcountry={(e)=>console.log(e.target.value)}
 />

              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  type="date"
                  label="Date Departure"
                  defaultValue= {moment().format("YYYY-MM-DD")}


                  fullWidth
                  id="email"
                  name="email"
                  autoComplete="off"
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  name="password"
                  type="date"
                  defaultValue= {moment().add(7, 'days').format("YYYY-MM-DD")
                }

                  id="password"
                  label="Date"
                  autoComplete="off"
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  name="password"
                  type="number"
                  defaultValue="1"
                  id="password"
                  label="availble space"
                  autoComplete="off"
                  onInput={(e) => {
                    e.target.value = Math.max(0, parseInt(e.target.value))
                      .toString()
                      .slice(0, 2);
                  }}
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  name="password"
                  type="text"
                  multiline
                  id="password"
                  label="Note"
                  autoComplete="off"

                />
              </Grid>
            </Grid>
            <Button
                        style={{marginTop:10}}

              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 }}
            >
              Create Post
            </Button>
            <Grid container justifyContent="flex-end">
              <Grid item>

              </Grid>
            </Grid>
          </Box>
        </Box>
      </Container>
    </ThemeProvider>
  );
}
